import React,{useState} from 'react'
import Footer from '../main/Footer'
import Adminheader from './Adminheader'

const Adminhome = () => {
    const [isOpen, setIsOpen] = useState(false);
            const toggleDropdown = () => {
                setIsOpen(false);
              };
  return (
    <>
    <div className='flex flex-col min-h-screen'>
      <Adminheader isOpen={isOpen} setIsOpen={setIsOpen}/>
      <div className='flex-grow bg-slate-100 py-10 overflow-scroll mt-24' onClick={toggleDropdown}>
              <div className='bg-gray-500 container m-auto mx-auto items-center  flex justify-around flex-col md:flex-row sm:flex-row' >




              </div>


          </div>
      <Footer/>

    </div>
    </>
  )
}

export default AdminHome
